import React from "react";
import "./styles.scss";
import useStyles from "./styles";
import { Box, Grid, Typography } from "@material-ui/core";

export default function Home() {
  const classes = useStyles(props);
  console.log(classes);
  return (
    <Box className="home-admin mt-5">
      <Grid container className="list-top px-3" spacing={1}>
        <Grid item xs className="">
          <Box>
            <Typography variant="body1" color="#999">
              Used Space
            </Typography>
          </Box>
        </Grid>
        <Grid item xs>
          <Box></Box>
        </Grid>
        <Grid item xs>
          <Box></Box>
        </Grid>
        <Grid item xs>
          <Box></Box>
        </Grid>
      </Grid>
    </Box>
  );
}
